import { IconButton, Toolbar, MenuItem } from "@material-ui/core";
import React from "react";
import images from "../../assets";
import { Container, Logo, Navbar } from "./styles";

function NavBar() {
  return (
    <>
      <Navbar>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
        </Toolbar>
        <Container>
          <Logo src={images.houseLogo}></Logo>
        </Container>
      </Navbar>
    </>
  );
}

export default NavBar;
